import React from 'react';

function ProfilePage({ user }) {
  // Assuming user object has username and password
  const { username, password } = user;

  return (
    <div>
      <h2>Profile Page</h2>
      <p>Username: {username}</p>
      <p>Password: {password}</p>
    </div>
  );
}

export default ProfilePage;
